import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './components/Home';
import SearchResults from './components/SearchResults';
import Apartment1 from './components/Apartment1';
import Apartment2 from './components/Apartment2';
import Apartment3 from './components/Apartment3';
import BookingForm from './components/BookingForm';
import Contact from './components/Contact';
import About from './components/About';
import 'bootstrap/dist/css/bootstrap.min.css';

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/search" element={<SearchResults />} />
        <Route path="/apartment/1" element={<Apartment1 />} />
        <Route path="/apartment/2" element={<Apartment2 />} />
        <Route path="/apartment/3" element={<Apartment3 />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
